import React, { useState, useEffect } from "react";
import "./css/Goals.css";

const initialGoals = [
  { imgSrc: "/img/goal1.jpg", title: "–ü—ñ—Ç–∏ –≤ —Å–ø–æ—Ä—Ç–∑–∞–ª", completed: false },
  { imgSrc: "/img/goal2.webp", title: "–ö—É–ø–∏—Ç–∏ –Ω–æ–≤–∏–π —Ç–µ–ª–µ—Ñ–æ–Ω", completed: false },
  { imgSrc: "/img/goal3.jpg", title: "–ü–æ—ó—Ö–∞—Ç–∏ –≤ –Ü—Ç–∞–ª—ñ—é", completed: false },
  { imgSrc: "/img/goal4.jpg", title: "–ü—Ä–æ—á–∏—Ç–∞—Ç–∏ —Ç—Ä–∏ –∫–Ω–∏–≥–∏", completed: false },
  { imgSrc: "/img/goal5.jpg", title: "–ù–∞–≤—á–∏—Ç–∏—Å—è –≥—Ä–∞—Ç–∏ –Ω–∞ –≥—ñ—Ç–∞—Ä—ñ", completed: false },
  { imgSrc: "/img/goal6.jpg", title: "–ö—É–ø–∏—Ç–∏ –Ω–∞–≤—É—à–Ω–∏–∫–∏", completed: false },
  { imgSrc: "/img/goal7.png", title: "–ó–¥–∞—Ç–∏ IELTS", completed: false },
  { imgSrc: "/img/goal8.jpg", title: "–ö—É–ø–∏—Ç–∏ —Å–µ—Ä–µ–∂–∫–∏", completed: false },
  { imgSrc: "/img/goal9.webp", title: "–ö—É–ø–∏—Ç–∏ –¥—É—Ö–∏", completed: false },
  { imgSrc: "/img/goal10.webp", title: "–û—Å–≤–æ—ó—Ç–∏ HTML —ñ CSS", completed: false },
  { imgSrc: "/img/goal11.webp", title: "–ö—É–ø–∏—Ç–∏ Porsche", completed: false },
  { imgSrc: "/img/goal12.jpeg", title: "–ö—É–ø–∏—Ç–∏ Dyson", completed: false },
];

const motivationMessages = [
  "üî• –ù—ñ–∫–æ–ª–∏ –Ω–µ –∑–¥–∞–≤–∞–π—Å—è ‚Äì —Ç–∏ –±–ª–∏–∂—á–µ, –Ω—ñ–∂ –∑–¥–∞—î—Ç—å—Å—è!",
  "üí™ –ö–æ–∂–µ–Ω –¥–µ–Ω—å ‚Äì —Ü–µ —â–µ –æ–¥–∏–Ω –∫—Ä–æ–∫ –¥–æ –º—Ä—ñ—ó!",
  "üöÄ –î—ñ–π —Å—å–æ–≥–æ–¥–Ω—ñ, –∞ –Ω–µ –∑–∞–≤—Ç—Ä–∞!",
  "üåü –ú–∞–ª–µ–Ω—å–∫—ñ –¥–æ—Å—è–≥–Ω–µ–Ω–Ω—è –≤–µ–¥—É—Ç—å –¥–æ –≤–µ–ª–∏–∫–∏—Ö –ø–µ—Ä–µ–º–æ–≥!",
  "üéØ –§–æ–∫—É—Å—É–π—Å—è –Ω–∞ —Ä–µ–∑—É–ª—å—Ç–∞—Ç—ñ, –∞ –Ω–µ –Ω–∞ —Ç—Ä—É–¥–Ω–æ—â–∞—Ö!",
];

const Goals = () => {
  const [goals, setGoals] = useState(initialGoals);
  const [filter, setFilter] = useState("all");
  const [motivation, setMotivation] = useState("");

  useEffect(() => {
    const randomMessage = motivationMessages[Math.floor(Math.random() * motivationMessages.length)];
    setMotivation(randomMessage);
  }, []);

  const toggleGoal = (index) => {
    setGoals((prevGoals) =>
      prevGoals.map((goal, i) =>
        i === index ? { ...goal, completed: !goal.completed } : goal
      )
    );
  };

  const deleteGoal = (index) => {
    setGoals((prevGoals) => prevGoals.filter((_, i) => i !== index));
  };

  const filteredGoals = goals.filter((goal) =>
    filter === "all" ? true : filter === "completed" ? goal.completed : !goal.completed
  );

  return (
    <section id="goals">
      <p className="motivation-message">{motivation}</p>

      <div className="filter-container">
        <label>–§—ñ–ª—å—Ç—Ä:</label>
        <select onChange={(e) => setFilter(e.target.value)} value={filter}>
          <option value="all">–í—Å—ñ</option>
          <option value="active">–ê–∫—Ç–∏–≤–Ω—ñ</option>
          <option value="completed">–í–∏–∫–æ–Ω–∞–Ω—ñ</option>
        </select>
      </div>

      <div className="goal-cards">
        {filteredGoals.map((goal, index) => (
          <article className={`goal-card ${goal.completed ? "completed" : ""}`} key={index}>
            <img src={goal.imgSrc} alt={goal.title} />
            <h3>{goal.title}</h3>
            <button className="mark-done" onClick={() => toggleGoal(index)}>
              {goal.completed ? "–í–∏–∫–æ–Ω–∞–Ω–æ" : "–í–∏–∫–æ–Ω–∞—Ç–∏"}
            </button>
            <button className="delete-goal" onClick={() => deleteGoal(index)}>‚úñ</button>
          </article>
        ))}

        <article className="goal-card add-goal">
          <div className="plus-sign">+</div>
          <h3>–î–æ–¥–∞—Ç–∏ —Ü—ñ–ª—å</h3>
        </article>
      </div>
    </section>
  );
};

export default Goals;
